import { createBrowserRouter } from "react-router-dom";
import Homepage from "./page/Homepage";
import SerachFilterData from "./component/SerachFilterData";

const router = createBrowserRouter([
  {
    path: "/",
    element: (
      <>
        <Homepage />
      </>
    ),
  },
  {
    path: "/:userData",
    element: (
      <>
        <SerachFilterData />
      </>
    ),
  },
  {
    path: "/:userData",
    element: (
      <>
        <SerachFilterData />
      </>
    ),
  },
]);

export default router;
